description:
A home invasion robbery ends in tragedy when a member of the wealthy Tyrell family is killed. Their live-in nanny, Claudia, begins to secretly suspect that her troubled brother may be the murderer.

Unwilling to share her suspicions until she is certain, Claudia begins her own investigation, which takes her down a very dark and unexpected  road. The more that Claudia finds out about the  killer, the closer she comes to their secrets, ultimately putting her own life in terrible danger...
